import './index.css';
import React from 'react';
import ReactDOM from 'react-dom';

const BookList=()=>{
return(
<session className="booklist">
	<Book/>
	<Book/>
	<Book/>
</session>
)
}
const Book=()=>{
return(
<div className='book'>
	<Title/>
	<Image/>
	<Author/>
</div>
)
}
const Title=()=>{
return(
<div>
	<p>The Money! </p>
</div>
)
}
const Image=()=>{
return(
<div>
	<img src="https://www.amazon.com/sljsakoxvfjav" alt="not found" />
</div>
)
}
const Author=()=>{
return(
<div>
	<i style="font-size:0.75rem; margin-top:0.25rem;background-color:white;"> Hello </i>
	<i style={{fontSize:'0.75rem', marginTop:'0.25rem',backgroundColor:'white'}}> Hello </i>
</div>
)
}

ReactDOM.render(<BookList/>, document.getElementById('root'));
